import styled from "styled-components";

export const Container = styled.div`

    .user-insert {
        input {
            background: aliceblue;
            border-radius: 5px;
            border: 1px solid black;
            pad: 5px;
            margin-top: 5px;
            font-size: 16px;
            color: dimgray;
        }

        label {
            font
        }
    }
`
